import React, { useState } from "react";
import editIcon from "../images/editIcon.png";
import deleteIcon from "../images/deleteIcon.png";
import shareIcon from "../images/shareIcon.png";
import { useNavigate } from "react-router-dom";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import DeleteQuizPopup from "./DeleteQuizPopup";

function Analytics() {
  const navigate = useNavigate();

  const handleQuestionWiseAnalysis = () => {
    navigate("/pollAnalysis");
  };

  const handleShareBtn = () => {
    toast.success("Link copied to Clipboard");
  };

  const [isDeleteBtnClicked, setIsDeleteBtnClicked] = useState(false);
  const handleDeleteBtn = () => {
    setIsDeleteBtnClicked(true);
  };

  if (isDeleteBtnClicked) {
    return <DeleteQuizPopup />;
  }
  return (
    <div>
      <p
        style={{
          color: "#5076FF",
          fontWeight: "600",
          fontSize: "2.5em",
          textAlign: "center",
          marginTop: "10vh",
        }}
      >
        Quiz Analysis
      </p>

      <div style={{ height: "63vh", overflowY: "auto", overflowX: "hidden" }}>
        <p
          style={{
            width: "72vw",
            marginLeft: "4vw",
            marginRight: "4vw",
            color: "#FFFFFF",
            backgroundColor: "#5076FF",
            marginTop: "8vh",
            borderRadius: "10px",
            fontSize: "1.1em",
            paddingTop: "1.5vh",
            paddingBottom: "1.5vh",
            fontWeight: "600",
          }}
        >
          <span
            style={{
              marginLeft: "1.5vw",
              width: "5vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            S.No
          </span>
          <span
            style={{
              width: "10vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            Quiz Name{" "}
          </span>
          <span
            style={{
              width: "14vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            Created on
          </span>
          <span
            style={{
              width: "10vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            Impression
          </span>
        </p>

        <p
          style={{
            width: "72vw",
            marginLeft: "4vw",
            marginRight: "4vw",
            color: "#000000",
            borderRadius: "10px",
            fontSize: "1.1em",
            paddingTop: "1vh",
            paddingBottom: "1.2vh",
            fontWeight: "600",
          }}
        >
          <span
            style={{
              marginLeft: "1.5vw",
              width: "5vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            1
          </span>
          <span
            style={{
              width: "10vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            Quiz 1
          </span>
          <span
            style={{
              width: "14vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            01 Sep, 2023
          </span>
          <span
            style={{
              width: "10vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            345
          </span>
          <span
            style={{
              marginLeft: "1vw",
              width: "7vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            <img src={editIcon} alt="editIcon" />
            <span style={{ marginLeft: "0.5vw" }}>
              <img
                onClick={handleDeleteBtn}
                style={{ cursor: "pointer" }}
                src={deleteIcon}
                alt="editIcon"
              />
            </span>
            <span style={{ marginLeft: "0.2vw" }}>
              <img
                onClick={handleShareBtn}
                style={{ cursor: "pointer" }}
                src={shareIcon}
                alt="editIcon"
              />
            </span>
          </span>

          <span
            onClick={handleQuestionWiseAnalysis}
            style={{
              width: "14vw",
              textAlign: "center",
              display: "inline-block",
              marginLeft: "1vw",
              textDecoration: "underline",
              cursor: "pointer",
            }}
          >
            Question Wise Analysis
          </span>
        </p>

        <p
          style={{
            width: "71.8vw",
            marginLeft: "4vw",
            marginRight: "4vw",
            color: "#000000",
            backgroundColor: "#B3C4FF",
            borderRadius: "10px",
            fontSize: "1.1em",
            paddingTop: "1vh",
            paddingBottom: "1.2vh",
            fontWeight: "600",
          }}
        >
          <span
            style={{
              marginLeft: "1.5vw",
              width: "5vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            2
          </span>
          <span
            style={{
              width: "10vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            Quiz 2
          </span>
          <span
            style={{
              width: "14vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            04 Sep, 2023
          </span>
          <span
            style={{
              width: "10vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            2000
          </span>
          <span
            style={{
              marginLeft: "1vw",
              width: "7vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            <img src={editIcon} alt="editIcon" />
            <span style={{ marginLeft: "0.5vw" }}>
              <img src={deleteIcon} alt="deleteIcon" />
            </span>
            <span style={{ marginLeft: "0.2vw" }}>
              <img src={shareIcon} alt="shareIcon" />
            </span>
          </span>
          <span
            style={{
              width: "14vw",
              textAlign: "center",
              display: "inline-block",
              marginLeft: "1vw",
              textDecoration: "underline",
            }}
          >
            Question Wise Analysis
          </span>
        </p>

        <p
          style={{
            width: "72vw",
            marginLeft: "4vw",
            marginRight: "4vw",
            color: "#000000",
            borderRadius: "10px",
            fontSize: "1.1em",
            paddingTop: "1vh",
            paddingBottom: "1.2vh",
            fontWeight: "600",
          }}
        >
          <span
            style={{
              marginLeft: "1.5vw",
              width: "5vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            1
          </span>
          <span
            style={{
              width: "10vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            Quiz 1
          </span>
          <span
            style={{
              width: "14vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            01 Sep, 2023
          </span>
          <span
            style={{
              width: "10vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            345
          </span>
          <span
            style={{
              marginLeft: "1vw",
              width: "7vw",
              display: "inline-block",
              textAlign: "center",
            }}
          >
            <img src={editIcon} alt="editIcon" />
            <span style={{ marginLeft: "0.5vw" }}>
              <img src={deleteIcon} alt="editIcon" />
            </span>
            <span style={{ marginLeft: "0.2vw" }}>
              <img src={shareIcon} alt="editIcon" />
            </span>
          </span>
          <span
            style={{
              width: "14vw",
              textAlign: "center",
              display: "inline-block",
              marginLeft: "1vw",
              textDecoration: "underline",
            }}
          >
            Question Wise Analysis
          </span>
        </p>
      </div>
      <p
        style={{
          textAlign: "right",
          color: "#474444",
          marginRight: "2vw",
          marginTop: "5vh",
          marginBottom: "2vh",
          fontSize: "1.2em",
          fontWeight: "600",
        }}
      >
